import 'dart:convert';enum Type {  set,  lavash,  shaurma,  donar,  xaggi,  burgers,  hotDog,  garniri,  souse,  napitk,  deserts,  morojonoe,}List<Foods> listFromJson(Map map) {  List result = [];  map.forEach((key, value) {    result.add(value);  });  List<Foods> foods = result.map((e) =>      Foods.fromJson(          e))      .toList();  return foods;}class Foods {  final String name;  final String image;  final String price;  final String about;  final bool have;  final String type;  Foods(      {required this.name, required this.image, required this.price, required this.about, required this          .type, required this          .have});  Foods.fromJson(Map<String, dynamic> json)      : name = json['name'],        image = json['image'],        price = json['price'],        type =json['type'],        about =json['about'],        have =json['have'];  Map<String, dynamic> toJson() =>      {        'name': name,        'image': image,        'price': price,        'about': about,        'type': type,        'have': have,      };  @override  String toString() {    return 'Foods{name: $name, image: $image, price: $price, about: $about}';  }}